INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (4, 0.0, 10021, "2019/07/31 12:00:00", 4, 24015, 0.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (4, 0.0, 10021, "2019/07/31 12:00:00", 1, 24016, 4.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (4, 0.0, 10021, "2019/07/31 12:00:00", 4, 24017, 0.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (1, 0.0, 10021, "2019/07/31 12:00:00", 2, 24018, 5.2, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (5, 0.0, 10021, "2019/07/31 12:00:00", 6, 24019, 4.2, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (2, 0.0, 10021, "2019/07/31 12:00:00", 2, 24020, 0.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (1, 0.0, 10021, "2019/07/31 12:00:00", 6, 24021, 6.4, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (2, 0.0, 10021, "2019/07/31 12:00:00", 2, 24022, 0.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (6, 0.0, 10021, "2019/07/31 12:00:00", 3, 24023, 10.08, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (1, 0.0, 10021, "2019/07/31 12:00:00", 2, 24024, 5.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (2, 0.0, 10021, "2019/07/31 12:00:00", 2, 24025, 0.0, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 110501, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0);
